import React from "react";

const PriceSection = () => {
  const likes = 4;

  return (
    <div className="price-section pl-6">
      <span className="text-2xl font-bold mb-8 block">$192</span>
      <div className="likes flex">
        <div className="likes-star flex">
          <img src="./assets/stars.svg" alt="stars" className="w-10" />
          <img src="./assets/stars.svg" alt="stars" className="w-10"  />
          <img src="./assets/stars.svg" alt="stars" />
          <img src="./assets/stars.svg" alt="stars" />
          <img src="./assets/stars.svg" alt="stars" />
        </div>
        <span>112 Likes</span>
      </div>
    </div>
  );
};

export default PriceSection;
